import { BrowserRouter, Routes, Route, NavLink } from 'react-router-dom';
import React from 'react'
import './App.css';


function App() {

  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<DataLayout />}>
          <Route index element={<CNFTData />}/>
          <Route element={<CryptoData />} />
        </Route>
      </Routes>
    </BrowserRouter >
  );
}

export default App;
